	add("snood", "{\"term\":\"snood\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|snod}}, from Old english (ca. 450-1100) {{m|ang|snōd||headdress, fillet, snood}}, from Proto-germanic {{m|gem-pro|*snōdō||rope, string}}, from Proto-indo-european {{m|ine-pro|*snōtéh₂||yarn, thread}}, from {{m|ine-pro|*sneh₁-|*sneh₁(i)-|to twist, wind, weave, plait}}. Cognate with Scots {{m|sco|snuid||snood}}, Swedish {{m|sv|snod}}, {{m|sv|snodd||twist, twine}}. Compare also Old Saxon {{m|osx|snōva||necklace}}, Old Norse {{m|non|snúa||to turn, twist}}, Old Norse {{m|non|snúðr||a twist, twirl}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A band or ribbon for keeping the hair in place, including the hair-band formerly worn in Scotland and northern England by young unmarried women\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A small hairnet or cap worn by women to keep their hair in place\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And seldom was a \u0027\u0027snood\u0027\u0027 amid / Such wild, luxuriant ringlets hid\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 264\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"serious girls with their hair in \u0027\u0027snoods\u0027\u0027 entered numbers into logbooks\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The flap of red skin on the beak of a male turkey\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Gary Clancy, \u0027Turkey Hunting Tactics\u0027, page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A fingerlike projection called a \u0027\u0027\u0027snood\u0027\u0027\u0027 hangs over the front of the beak. When the tom is alert, the \u0027\u0027snood\u0027\u0027 constricts and projects vertically as a fleshy bump at the top rear of the beak\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A short line of horsehair, gut, monofilament, etc., by which a fishhook is attached to a longer (and usually heavier) line; a snell\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A piece of clothing to keep the neck warm; neckwarmer\", \"priority\":11}]}, \"synonyms\":{}}");

