	add("snoopervision", "{\"term\":\"snoopervision\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|snoop|supervision|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Oversight deemed to be excessively invasive or prying\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, Floyd Tompkins Goodier, \u0027Administration of Town and Village Schools\u0027, Webster Publishing Co. (1938), page 91\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some of the supervision of the past has been rightfully called \u0026quot;\u0027\u0027snoopervision\u0027\u0027\u0026quot; because it had as its chief concern the activities of the teachers\", \"priority\":3}]}, \"synonyms\":{}}");

