	add("snort", "{\"term\":\"snort\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027snorten\u0027 an onomatopoeic variant of Middle english (1100-1500) \u0027snoren\u0027 from Proto-germanic {{m|gem-pro|*snarkjaną}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The sound made by exhaling or inhaling roughly through the nose\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A dose of a drug to be snorted. Here, \u0026quot;drug\u0026quot; includes snuff (i.e., pulverized tobacco). A snort also may be a drink of whiskey, as \u0026quot;Let\u0027s have a snort\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An alcoholic drink\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1951\u0027\u0027, \u0027Indiana Historical Society Publications\u0027 (volumes 16-17, page 157\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Everybody tipped up the jug and took a \u0027\u0027snort\u0027\u0027 of whisky and followed it with a gourd of cool water. We thought a snort of whisky now and then braced us up some and put a little more lift in us\", \"priority\":5}]}, \"synonyms\":{}}");

	add("snorer", "{\"term\":\"snorer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|snore|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who snores (or is snoring\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One \u0027\u0027snorer\u0027\u0027 can keep a whole room of sleepy people awake\", \"priority\":2}]}, \"synonyms\":{}}");

	add("snoring", "{\"term\":\"snoring\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action or sound of breathing during sleep with harsh, snorting noises caused by vibration of the soft palate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027snoring\u0027\u0027 was so loud that it woke the neighbors\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"E. E. Cumming\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Then he asked if anyone wanted to dispute this assertion (he brandishing his revolver the while) and was answered by peaceful \u0027\u0027snorings\", \"priority\":4}]}, \"synonyms\":{}}");

	add("snorkel", "{\"term\":\"snorkel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\"], \"text\":\"From German \u0027schnorchel\u0027 (nose, snout) related to \u0027schnarchen\u0027 (to snore) So called from its resemblance to a nose and its noise when in use. The anglicized spelling first recorded 1949.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hollow tube, held in the mouth, used by swimmers for breathing underwater\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A retractable tube fitted in diesel-engine submarines to allow sufficient ventilation that the engines may be used at periscope depth\", \"priority\":2}]}, \"synonyms\":{}}");

