	add("snotball", "{\"term\":\"snotball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snot|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ball of mucus ejected from the mouth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Joseph C. Becker III, Eric A. Zilli, \u0027Twilight: The Waning Days of Youth\u0027 (page 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Without turning, Mike bent his head down just in time to avoid a huge \u0027\u0027snotball\u0027\u0027 meant for his skull. Instead, a freshman a few feet away was the recipient of the unwholesome mucous present\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Brad Bauer, \u0027Hitting in the Clutch\u0027 (page 69\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Fischer sees it and gets red in the face, then hawks up a \u0027\u0027snotball\u0027\u0027 and spits at my cleat. It hits dead on, and I shove him on the bench. He shoves me back, and I stand up\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Doug Lambeth, \u0027Itchy Donner\u0027 (page 160\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t it bother you that Jason Bent and those other little \u0027\u0027snotballs\u0027\u0027 treat him like a doormat\", \"priority\":7}]}, \"synonyms\":{}}");

