	add("snotter", "{\"term\":\"snotter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rope going over a yardarm, used to bend a tripping line to, in sending down topgallant and royal yards in vessels of war; also, the short line supporting the heel of the sprit in a small boat\", \"priority\":1}]}, \"synonyms\":{}}");

