	add("snout", "{\"term\":\"snout\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"Proto-Germanic\", \"middle low german\", \"saterfriesisch\"], \"text\":\"Of Proto-germanic origin; probably from Middle low german or Middle dutch (ca. 1050-1350) \u0027snute\u0027 Compare Saterfriesisch {{m|stq|Snuute||snout}}, Dutch \u0027snuit\u0027 German \u0027schnauze\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The long, projecting nose, mouth, and jaw of a beast, as of pigs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The pig rooted around in the dirt with its \u0027\u0027snout\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The front of the prow of a ship or boat. \u0026lt;ref name\u003dCOED2\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[https://openlibrary.org/works/OL10563347W The Three Corpse section\u003dchapter passage\u003dThe dinghy was trailing astern at the end of its painter, and Merrion looked at it as he passed. He saw that it was a battered-looking affair of the prahm type, with a blunt \u0027\u0027snout\u0027\u0027, and like the parent ship, had recently been painted a vivid green\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s nose\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"His glasses kept slipping further down onto his prominent \u0027\u0027snout\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The nozzle of a pipe, hose, etc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"If you place the \u0027\u0027snout\u0027\u0027 right into the bucket, it won\u0027t spray as much\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The anterior prolongation of the head of a gastropod; a rostrum\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The anterior prolongation of the head of weevils and allied beetles; a rostrum\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Tobacco; cigarettes\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, Len Deighton, \u0027Only When I Laugh\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Bob, p. 55:) Charlie was the most vicious screw on the block ... He caught me with the two ounces of snout right in my hand, caught me by the hair, and swung me round in the exercise yard\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Spider, p. 175:) She brings me snout and sweets, and sometimes a cake from Mum\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Edward Bond, \u0027Saved\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"LIZ. I only got one left. / FRED (calls). Get us some \u0027\u0027snout\u0027\u0027. / MIKE. Five or ten\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Joe Randolph Ackerley, P N Furbank, \u0027We Think the World of You\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Also he was \u0026quot;doing his nut\u0026quot; for some \u0026quot;\u0027\u0027snout\u0027\u0027.\u0026quot; I said I would provide cigarettes\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Allan Sillitoe, \u0027New and Collected Stories\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Raymond rolled a neat cigarette. \u0026quot;What about some \u0027\u0027snout\u0027\u0027, then?\u0026quot; \u0026quot;No, thanks.\u0026quot; He laughed. Smoke drifted from his open mouth\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The terminus of a glacier\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A police informer\", \"priority\":22}]}, \"synonyms\":{}}");

	add("snows", "{\"term\":\"snows\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027snows\u0027\u0027 in Alaska are quite different from the \u0027\u0027snows\u0027\u0027 here\", \"priority\":1}]}, \"synonyms\":{}}");

	add("snowball", "{\"term\":\"snowball\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"saterfriesisch\"], \"text\":\"From Middle english (1100-1500) \u0027snoweball\u0027 {{m|enm|snoweballe}}, \u0027snaweballe\u0027 {{m|enm|snayballe}}, equivalent to {{compound|snow|ball|lang\u003den|nocat\u003d1}}. Cognate with Saterfriesisch {{m|stq|Sneebaal||snowball}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ball of snow, usually one made in the hand and thrown for amusement in a snowball fight; also a larger ball of snow made by rolling a snowball around in snow that sticks to it and increases its diameter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cocktail made from lemonade and advocaat\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something that snowballs (grows rapidly out of control\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Eldad Ben-Yosef, \u0027The Evolution of the US Airline Industry\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Representatives of the small airlines that felt betrayed by Brown\u0027s policy started a political \u0027\u0027snowball\u0027\u0027 rolling, resulting in the Airmail Act of 1934\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A sex act involving passing ejaculated semen from one person\u0027s mouth to another\u0027s\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A type of ice dessert\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A type of cake\", \"priority\":8}]}, \"synonyms\":{}}");

	add("snowbank", "{\"term\":\"snowbank\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snow|bank|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A heap of snow\", \"priority\":1}]}, \"synonyms\":{}}");

	add("snowbase", "{\"term\":\"snowbase\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snow|base|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The snow which is settled on the ground in below melting point conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("snowberry", "{\"term\":\"snowberry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snow|berry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A shrub bearing white berries, now especially of the genus \u0027Symphoricarpos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The fruit of this shrub\", \"priority\":2}]}, \"synonyms\":{}}");

	add("snowbird", "{\"term\":\"snowbird\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snow|bird|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bird, \u0027Junco hyemalis\u0027, the dark-eyed junco\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A bird seen primarily in the winter time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The snow bunting (\u0027Plectrophenax nivalis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person, usually one who is retired, who travels from a cold climate to a warmer one in the winter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A cocaine user\", \"priority\":5}]}, \"synonyms\":{}}");

