	add("snowboard", "{\"term\":\"snowboard\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From English {{m|en|snowboard}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a board, somewhat like a broad ski, or a very long skateboard with no wheels, used in the sport of snowboarding\", \"priority\":1}]}, \"synonyms\":{}}");

	add("snowclone", "{\"term\":\"snowclone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Blend of \u0027snow cone\u0027 and \u0027clone\u0027, after the popular idea that the Inuit have a large number of words for different types of snow; coined by Glen Whitman in response to w:Geoffrey Pullum|Geoffrey Pullum on the blog \u0027w:Language Log|Language Log\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of cliché which uses an old idiom formulaically in a new context\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 Nov 5, auuV, \u0026quot;Some articles that I like. They are about language,\u0026quot; \u0026lt;tt\u0026gt;alt.running.out.of.newsgroup.names\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I stumbled upon the site the other day, when I was looking up the origins of the \u0026quot;Im not an X, but I play one on TV\u0026quot; \u0027\u0027snowclone\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 December 3, David Rowan, \u0026quot;Trendsurfing: \u0026lt;nowiki\u0026gt;\u0027\u0026lt;/nowiki\u0026gt;\u0027\u0027Snowclone\u0027\u0027\u0026lt;nowiki\u0026gt;\u0027\u0026lt;/nowiki\u0026gt; journalism\u0026quot; [http://www.davidrowan.com/2005/12/trendsurfing-snowclone-journalism.html], \u0027The Times\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Suddenly \u0027\u0027snowclone\u0027\u0027 hunters were documenting media usages suggesting that, in space, no one can hear you belch, bitch, blog, speak, squeak or suck\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 Jun 20, Michael Erard, \u0026quot;Analyzing Eggcorns and \u0027\u0027Snowclones\u0027\u0027, and Challenging Strunk and White\u0026quot;, in \u0027w:The New York The New York Times\u0027, page F\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Regular readers learned there first about \u0027\u0027snowclones\u0027\u0027, the basic building blocks of cliches, like \u0026quot;X is the new Y\u0026quot; or \u0026quot;you don\u0027t need a degree in A to do B.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 Jul, Mark Peters, \u0026quot;Not Your Father\u0027s Cliché\u0026quot;, in \u0027w:Columbia Journalism Columbia Journalism Review\u0027 45(2), page 1\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"If so, you\u0027re being snowed under by \u0027\u0027snowclones\u0027\u0027 \u0026amp;mdash; a category of fill-in-the-blank cliché identified by linguists\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 Nov 18, unknown author, \u0026quot;\u0027\u0027Snowclone\u0027\u0027\u0026quot;, in \u0027w:New New Scientist\u0027 192(2578), page 8\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"When you read phrases like these in a newspaper, you\u0027ve stumbled across a particular type of cliché: the \u0027\u0027snowclone\", \"priority\":11}]}, \"synonyms\":{}}");

	add("snowcock", "{\"term\":\"snowcock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snow|cock|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several species of bird in the genus \u0027Tetraogallus\u0027 of the pheasant family Phasianidae\", \"priority\":1}]}, \"synonyms\":{}}");

	add("snowdon", "{\"term\":\"snowdon\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) meaning \u0027snow hill\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the highest mountain in Wales\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"any of several small places in Britai\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an English habitational surname for someone who lived in any of these places\", \"priority\":3}]}, \"synonyms\":{}}");

	add("snowdrop", "{\"term\":\"snowdrop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|snow|drop|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the 20 species of the genus \u0027Galanthus\u0027 of the Amaryllidaceae, bulbous flowering plants, bearing a solitary, pendulous, white, bell-shaped flower that appears, depending on species, between autumn and late winter or early spring, all native to temperate Eurasia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("snower", "{\"term\":\"snower\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|snow|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that or somebody who snows, or makes snow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"w:Colonel Tom Colonel Tom Parker, as explained in Alanna Nash, \u0027The Colonel: The Extraordinary Story of Colonel Tom Parker and Elvis Presley\u0027, Simon and Schuster (2003), ISBN 978-0-7432-1301-1, [http://books.google.com/books?id\u003d2-HvQBbihNkC\u0026amp;pg\u003dPA155\u0026amp;dq\u003dsnowers page 155\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"another standard of excellence: the ability to con, or “snow.” ¶ The coup de grâce of Parker’s little folly was the club’s slickly produced rule book, which the Colonel called a \u0027Confidential Report Dealing with Advanced Techniques of Member \u0027\u0027Snowers\u0027\u0027\u0027, prepared by a team “notably skilled in evasiveness and ineptitude\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, John Oliver Killens, \u0027The Cotillion: or, One Good Bull Is Half the Herd\u0027,\u0026lt;sup \u0026gt;[http://www.amazon.com/Cotillion-Good-Bull-Black-Movement/dp/1566891191 ]\u0026lt;/sup\u0026gt; Coffee House Press (2002), ISBN 978-1-56689-119-6, page 148\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There was snow out on the Harlem streets, and inside the Lovejoys, Ben Ali did a snow job on her Highness, Lady Daphne. And it required a lot of snowing by a champeen \u0027\u0027snower\u0027\u0027; the Lady was nobody’s fool\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Jeanne Kelly and Nathan K. Mao (translators), w:Qian Qian Zhongshu (author), \u0027w:Fortress Fortress Besieged\u0027, New Directions Publishing (2004), ISBN 978-0-8112-1552-7, [http://books.google.com/books?id\u003dxzhpf1RW25MC\u0026amp;pg\u003dPA301\u0026amp;dq\u003dsnowers page 301\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Hsin-Mei said, “ When I was in America, people used to call the Foreign Students Summer Club the ‘Big Three Conference’: the show-offs, the suckers, and the—uh—the girl-\u0027\u0027snowers\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, Jane Louise Curry, \u0027The Lotus Cup\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dwXam4SchohgC ]\u0026lt;/sup\u0026gt; Atheneum, ISBN 9780689503849, page 43\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Maybe, Corry thought, that was what gardeners tended to in wintertime: snow. Would that make them “\u0027\u0027snowers\u0027\u0027?” or “snowmen\", \"priority\":9}]}, \"synonyms\":{}}");

	add("snowface", "{\"term\":\"snowface\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snow|face|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A snow-covered mountain feature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Louis W. Dawson, \u0027Wild Snow: A Historical Guide to North American Ski Mountaineering\u0027, [http://books.google.com/books?id\u003dD_1_rNG1rfYC\u0026amp;pg\u003dPA36\u0026amp;dq\u003d%22snowface%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dziEvT99nwaaJAryR5d4K\u0026amp;ved\u003d0CFcQ6AEwCQ page 36\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For the easiest descent, drop west from the summit into the Granite Chief Wilderness via a broad \u0027\u0027snowface\u0027\u0027, then climb back to the summit or any of several saddles, and descend Ward Creek back to parking\", \"priority\":3}]}, \"synonyms\":{}}");

	add("snowfall", "{\"term\":\"snowfall\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|snow|fall|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instance of falling of snow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There has been a snowfall every day this week\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The amount of snow that falls on one occasion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"London recorded a snowfall of 10 centimetres last night\", \"priority\":4}]}, \"synonyms\":{}}");

