	add("snowflake", "{\"term\":\"snowflake\", \"etymology\":{\"influencers\":[], \"languages\":[\"saterfriesisch\"], \"text\":\"From {{compound|snow|flake|lang\u003den}}\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt;. Compare Saterfriesisch {{m|stq|Sneeflokke||snowflake}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A crystal of snow, having approximate hexagonal symmetry.\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of several bulbous European plants, of the genus , having white flowers.\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The snow bunting, .\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who is unique and special (referring to the idea that no two snowflakes are identical in structure\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Well, aren\u0027t you a special \u0027\u0027snowflake\", \"priority\":5}]}, \"synonyms\":{}}");

