	add("snowmageddon", "{\"term\":\"snowmageddon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|snow|mageddon|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A severe blizzard or series of blizzards affecting one locale\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Chris Wright, \u0027Winter Blast‎\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Unfortunately, their peaceful existence would soon be disturbed by a new villain. More evil and twice as despicable, \u0027\u0027Snowmageddon\u0027\u0027 had come to town\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 Rose A. Valenta, \u0027Sitting on Cold Porcelain\u0027, Xlibris Corporation, ISBN 1450044190, page 17\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It was Super Bowl 44 Sunday. \u0027\u0027Snowmageddon\u0027\u0027 was upon us like “The Day After Tomorrow\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 February 6, “‘\u0027\u0027Snowmageddon\u0027\u0027’ brings Washington to a standstill”, \u0027The Guardian\", \"priority\":6}]}, \"synonyms\":{}}");

