	add("snowman", "{\"term\":\"snowman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A humanoid figure made with large snowballs stacked on each other. Human traits like a face and arms may be fashioned with sticks (arms), a carrot (nose), and stones or coal (eyes, mouth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A playing card with the rank of nine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A score of eight on a single hole\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An attractive but heartless man (similar to ice queen\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, w:John D. John D. Loudermilk in the song \u0026quot;The Great Snowman\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A few years ago there lived a lover By the name of Jimmy Jones Who really snowed the girls and left them cold And gained the title of \u0027The Great Snowman\", \"priority\":6}]}, \"synonyms\":{}}");

